  [],\n\t\"num_tags\": 0,\n\t\"name\": \"attributes-for-mrb-e2rf1-catchments-by-major-river-basins-in-the-conterminous-united-state-1997\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents the estimated
  area of artifical drainage for the year 1992 and irrigation types for the year 1997
  compiled for every MRB_E2RF1 catchment of Major River Basins (MRBs, Crawford and
  others, 2006). The source data sets were derived from tabular National Resource
  Inventory (NRI) data sets created by the National Resources Conservation Service
  (NRCS, U.S. Department of Agriculture, 1995, 2000). Artificial drainage is defined
  as subsurface drains and ditches. Irrigation types are defined as gravity and pressure.
  Subsurface drains are described as conduits, such as corrugated plastic tubing,
  tile, or pipe, installed beneath the ground surface to collect and/or convey drainage.
  Surface drainage field ditches are described as graded ditches for collecting excess
  water. Gravity irrigation source is described as irrigation delivered to the farm
  and/or field by canals or pipelines open to the atmosphere; and water is distributed
  by the force of gravity down the field by: (1) A surface irrigation system (border,
  basin, furrow, corrugation, wild flooding, etc.) or (2) Sub-surface irrigation pipelines
  or ditches. Pressure irrigation source is described as irrigation delivered to the
  farm and/or field in pump or elevation-induced pressure pipelines, and water is
  distributed across the field by: (1) Sprinkle irrigation (center pivot, linear move,
  traveling gun, side roll, hand move, big gun, or fixed set sprinklers), or (2) Micro
  irrigation (drip emitters, continuous tube bubblers, micro spray or micro sprinklers).
  NRI data do not include Federal lands and are thus excluded from this dataset. The
  tabular data for drainage were spatially apportioned to the National Land Cover
  Dataset (NLCD, Kerie Hitt, U.S. Geological Survey, written commun., 2005) and the
  tabular data for irrigation were spatially apportioned to an enhanced version of
  the National Land Cover Dataset (NLCDe, Nakagaki and others, 2007). The MRB_E2RF1
  catchments are based on a modified version of the U.S. Environmental Protection
  Agency's (USEPA) ERF1_2 and include enhancements to support national and regional-scale
  surface-water quality modeling (Nolan and others, 2002; Brakebill and others, 2011).
  Data were compiled for every MRB_E2RF1 catchment for the conterminous United States
  covering New England and Mid-Atlantic (MRB1), South Atlantic-Gulf and Tennessee
  (MRB2), the Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy (MRB3), the
  Missouri (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf (MRB5),
  the Rio Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest (MRB7)
  river basins, and California (MRB8).\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
